import React from 'react';
import './Sidebar.css';

function Sidebar({ onAddElement }) {
  const basicElements = [
    { type: 'innerSection', label: 'Inner Section', icon: '‚â°' },
    { type: 'heading', label: 'Heading', icon: 'T' },
    { type: 'image', label: 'Image', icon: 'üñºÔ∏è' },
    { type: 'text', label: 'Text Editor', icon: 'üìù' },
    { type: 'video', label: 'Video', icon: '‚ñ∂Ô∏è' },
    { type: 'button', label: 'Button', icon: 'üîò' },
    { type: 'divider', label: 'Divider', icon: '‚éØ' },
    { type: 'spacer', label: 'Spacer', icon: '‚ÜïÔ∏è' },
    { type: 'googleMaps', label: 'Google Maps', icon: 'üó∫Ô∏è' },
    { type: 'icon', label: 'Icon', icon: '‚òÖ' }
  ];

  const proElements = [
    { type: 'posts', label: 'Posts', icon: 'üìã' },
    { type: 'portfolio', label: 'Portfolio', icon: 'üìä' }
  ];

  return (
    <div className="sidebar">
      <div className="elements-category">
        <h3>BASIC</h3>
        <div className="elements-grid">
          {basicElements.map(element => (
            <div 
              key={element.type} 
              className="element-item"
              onClick={() => onAddElement(element.type)}
            >
              <div className="element-icon">{element.icon}</div>
              <div className="element-label">{element.label}</div>
            </div>
          ))}
        </div>
      </div>

      <div className="elements-category">
        <h3>PRO</h3>
        <div className="elements-grid">
          {proElements.map(element => (
            <div 
              key={element.type} 
              className="element-item"
              onClick={() => onAddElement(element.type)}
            >
              <div className="element-icon">{element.icon}</div>
              <div className="element-label">{element.label}</div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Sidebar;
